Possible race condition with cursor when using Promise.all<p>In the project that I am working on, built using nodejs &amp; mongo, there is a function that takes in a query and returns set of data based on limit &amp; offset provided to it. Along with this data the function returns a total count stating all the matched objects present in the database. Below is the function:</p>

<pre><code>// options carry the limit &amp; offset values
// mongoQuery carries a mongo matching query
function findMany(query, options, collectionId) {
    const cursor = getCursorForCollection(collectionId).find(query, options);
    return Promise.all([findManyQuery(cursor), countMany(cursor)]);
}
</code></pre>

<p>Now the problem with this is sometime when I give a large limit size I get an error saying:</p>

<pre><code>Uncaught exception:  TypeError: Cannot read property '_killCursor' of undefined
</code></pre>

<p>At first I thought I might have to increase the pool size in order to fix this issue but after digging around a little bit more I was able to find out that the above code is resulting in a race condition. When I changed the code to:</p>

<pre><code>function findMany(query, options, collectionId) {
  const cursor = getCursorForCollection(collectionId).find(query, options);
  return findManyQuery(cursor).then((dataSet) =&gt; {
    return countMany(cursor).then((count)=&gt; {
      return Promise.resolve([dataSet, count]);
    });
  );
}
</code></pre>

<p>Everything started working perfectly fine. Now, from what I understand with regard to Promise.all was that it takes an array of promises and resolves them one after the other. If the promises are executed one after the other how can the Promise.all code result in race condition and the chaining of the promises don't result in that.</p>

<p>I am not able to wrap my head around it. Why is this happening?</p>

