Lookup with concat followed by match, doesn't return the result of the latter<p>I'm new to MongoDB and I'm trying to perform aggregate of multiple collections in order to validate a HTTP request. Right now I need to lookup a collection, concat a value of the collection I've looked up with a given string and use the result of the concat on a match equals. The code below is what i currently have:</p>

<pre><code>{
  from: "Patient",
  let: {
    subject: "$subject.reference"
  },
  pipeline: [
    {
      $project: {
        concatTest: {
          $concat: [
            "Patient/",
            "$id"
          ]
        }
      }
    },
    {
      $match: {
        $expr: {
          $eq: [
            "$concatTest",
            "$$subject"
          ]
        }
      }
    }
  ],
  as: "result"
}
</code></pre>

<p>The problem:</p>

<p>The result array does not outputs the collection after filtering with match and instead outputs the results of the concat as shown:</p>

<pre><code>result:Array
0:Object
_id:5d6d13175def3532dd905767
concatTest:"Patient/5d6d13175def3532dd905767"
</code></pre>

<p>I'm guessing this is a pretty simple problem of placing the right output, however I can't find a solution to it. Maybe i shouldn't be doing concat inside the pipeline? Or I completely misunderstood out the pipeline works? </p>

<p>Thanks in advance.</p>

