Sending messages programe<p>The idea of the program is to send messages. User enter to the web select his id as (Sender) and select a (Receiver) id then press Submit. After that it takes him to a page shows all the messages were send to him with a box for him to send a message to the person that he chose his id (Receiver) previously.</p>

<p>I have an error and I don't know where . The program is not finished yet but I need to fix the error before moving.</p>

<p><strong>messages.js</strong> </p>

<pre><code>const mongoose = require('mongoose');
const Schema = mongoose.Schema;
const messageSchema = new Schema({

    message : {
        type : String,
    },

    sender : {
        type : Number,
    },
    receiver : {
        type : Number,
    },

});

const Message = mongoose.model('Message', messageSchema);
module.exports = Message;
</code></pre>

<p><strong>message.js</strong> //repository</p>

<pre><code>const Message = require('../models/messages');
const mongoose = require('mongoose');
class MessageRepository {


    async getMessages() {
            return await Message.find();
    }
    async addMessage(message) {
        message = await Message.create(message);
        return message;
    }

}
module.exports = new MessageRepository();
</code></pre>

<p><strong>message.js</strong>  //services</p>

<pre><code>const messageRepo = require('../repo/message')
class MessageService {


    async addMessage(req, res) {
        try {
            const messages = req.body;

            await messages.forEach(async(message)=&gt; await messageRepo.addMessage(message))
            res.send('All messages were added')


        } catch (err) {
            res. send(err)
        }
    }
    async getMessages(req, res) {

        try {
            const message = req.query.message;
            const messages = await messageRepo.getMessages(message);
            res.json(messages);
        } catch (err) {
            res.status(500).send(err);
        }

    }


}
module.exports = new MessageService();
</code></pre>

